import { FunctionComponent } from "react";
import { Modal } from "react-bootstrap";
import { deleteCardById } from "../services/cardList";

interface DeleteCardModalProps {
    show: boolean;
    onHide: Function;
    cardDes: string;
    setQuan: Function
}

const DeleteCardModal: FunctionComponent<DeleteCardModalProps> = ({ show, onHide, cardDes, setQuan }) => {
    return <>
        <Modal
            show={show}
            onHide={() => onHide()}
            size="sm"
            aria-labelledby="contained-modal-title-vcenter"
            centered
        >
            <Modal.Header closeButton>
                <Modal.Title id="contained-modal-title-vcenter">
                </Modal.Title>
            </Modal.Header>
            <Modal.Body>
                <p>
                    Are you sure you want to delete?
                </p>
            </Modal.Body>
            <Modal.Footer>
                <button onClick={() => {
                    deleteCardById(JSON.parse(localStorage.getItem("userId") as string), cardDes).then(() => { setQuan(JSON.parse(localStorage.getItem("quantity") as string)) }); onHide()
                }} className="btn btn-danger"> yes </button>
                <button onClick={() => onHide()} className="btn btn-info"> cancel </button>
            </Modal.Footer>
        </Modal>
    </>
}

export default DeleteCardModal;
